INSERT INTO `faq` VALUES (1,1,'General','What is Love Push?','We help you to connect quickly and easily with new people in your area or\r\naround the world.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(2,1,'General','How can I use Love Push?','You can install the app from Android and iOS App Stores.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(3,1,'General','Can Love Push be used anywhere in the world?','Yes, you can use the app worldwide!','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(4,1,'General','What is the minimum age to sign up?','The minimum age to sign up for LovePush is 18 years.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(5,1,'Registration and first steps','Can I register without Facebook/Instagram/G+?','Yes, you can also sign in with your mobile number.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(6,1,'Registration and first steps','How can I edit my profile?','You can edit your profile by clicking on your profile picture in the menu.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(7,1,'Registration and first steps','Where do I adjust my search settings?','You can change your search settings in the menu under Settings ? Filter.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(8,1,'Account','Where do I set the language?','Set your language by selecting \"Language\" in the settings.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(9,1,'Account','Can I deactivate message requests?','Yes, if you only want to be contacted by matches deactivate message requests in the settings under \"stop private messaging\".','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(10,1,'Account','Can I deactivate my account temporarily?','Temporarily deactivate your account by selecting \"Hide me from search\" in the settings.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(11,1,'Account','How do I delete my account?','Delete your account in the settings under \"Delete Account\".','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(12,1,'Account','How do I add images and how do I delete images of myself?','You can add and delete your pictures in the profile editing.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(13,1,'Features LovePush','Profile & Posts','Create an interesting and real profile!\r\nYou can also post pictures in your profile - pictures say more than 1000 words!','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(14,1,'Features LovePush','Swipe','You can choose between \"next\", \"connect\" or \"date\" request.\r\nAfter you have matched, you can start chatting.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(15,1,'Features LovePush','Radar','You have an overview of all people near you. Visit their profile and connect!','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(16,1,'Features LovePush','Love & Connect Ads','Publish Love or Connect ads in your chosen city and meet the right people in the right place.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(17,1,'Features LovePush','Personal Matching','You get suggestions for people who fit your character and who have the same interests as you.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(18,1,'Features LovePush','Around','Our integrated Google API allows you to explore the hottest bars, restaurants, festivals & concerts in your area and invite your contacts directly to them.','1','2019-10-07 16:12:41','2019-10-07 16:12:41'),(19,1,'Features LovePush','Live Streams','Start or join a live session in your area and watch, comment or join!','1','2019-10-07 16:12:41','2019-10-07 16:22:23'),(20,1,'Memberships','Free & V.I.P Pass','With our V.I.P. Pass you can use all our functions nearly unlimited and earn money with our affiliate program.\r\nFurther information can be found in the price information.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(21,1,'Memberships','Free Trial','For 3 days you can test the V.I.P. Pass and all features unlimited!','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(22,1,'Memberships','Love Points','Not another membership?\r\nWith the LovePoints you are completely free!\r\nGet as many Points as you want without recurring payments.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(23,1,'Memberships','Payment methods','The V.I.P. Pass can be purchased by PayPal, credit card and mobile phone number.\r\nYou can also secure LovePoints with Online Banking.\r\nThe membership fee is debited on the first day of each billing period.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(24,1,'Memberships','Renewal of membership','Your membership will be extended by one month at the end of each membership period.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(25,1,'Memberships','Cancellation of Membership','To cancel for the following month send your cancellation at least 5 days before your membership expires to termination@love-push.com or cancel directly in the app.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(26,1,'Memberships','Right of Withdrawal','Send us the right of withdrawal at the latest 14 days after conclusion of your membership to termination@love-push.com.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(27,1,'Affiliate','How do I become a Love Push Affiliate?','Agree to the Affiliate Terms & Conditions and owe an active V.I.P. Pass.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(28,1,'Affiliate','How do I get Team Partner?','All you must do is copy your referral code in the Affiliate Overview and send it to your friends.\r\nYou can also use it to advertise on social media.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(29,1,'Affiliate','From what date can I earn commissions?','You can use the time until the new year to build up your team.\r\nFrom January 2020 you will be able to earn your first commissions.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(30,1,'Affiliate','What is the compensation model?','You will be compensated on 5 levels, you can find the exact model in the Affiliate Information.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(31,1,'Affiliate','When do I have to request a withdrawal?','Until the 24th of each month in affiliate menu Withdrawal , if you have a minimum pay-out balance of 25$.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(32,1,'Affiliate','Where and when do I get my commissions paid?','If you have successfully applied for your pay-out you will get your commission paid to your PayPal account on the 1st of every month.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(33,1,'Affiliate','Do I have to take care of taxes myself?','Yes, Love Push pays you the commissions incl. Taxes to your PayPal account.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(34,2,'Allgemein','Was ist Love Push?','Mithilfe einzigartiger Funktionen helfen wir dir, schnell und einfach mit neuen Menschen in deiner Stadt oder auf der ganzen Welt in Kontakt zu treten!','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(35,2,'Allgemein','Wie kann ich Love Push nutzen?','Unsere App kannst du in den App Stores auf Android und iOS installieren.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(36,2,'Allgemein','Ist Love Push berall auf der Welt nutzbar?','Ja, du kannst die App weltweit nutzen!','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(37,2,'Allgemein','Was ist das Mindestalter, um sich anzumelden?','Das Mindestalter um sich bei LovePush anzumelden ist 18 Jahre.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(38,2,'Anmeldung und erste Schritte','Kann ich mich auch ohne Facebook/Instagram/G+ anmelden?','Ja, du kannst dich auch mit deiner','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(39,2,'Anmeldung und erste Schritte','Wie kann ich mein Profil bearbeiten?','Dein Profil bearbeitest du, indem du im Men auf dein Profilbild klickst.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(40,2,'Anmeldung und erste Schritte','Wo stelle ich meine Sucheinstellungen ein?','Deine Sucheinstellungen stellst du im Men unter Einstellungen ? Filter ein.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(41,2,'Account','Wo stelle ich die Sprache ein?','Stelle deine Sprache in den Einstellungen unter Sprache ein.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(42,2,'Account','Kann ich Nachrichtenanfragen deaktivieren?','Ja, wenn du nur von Matches angeschrieben werden willst deaktiviere Nachrichtenanfragen in den Einstellungen unter stop private messaging.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(43,2,'Account','Kann ich meinen Account vorrbergehend deaktivieren?','Deaktiviere deinen Account vorrbergehend, indem du in den Einstellungen unter Hide me from search.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(44,2,'Account','Wie lsche ich meinen Account?','Lsche deinen Account in den Einstellungen unter Delete Account.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(45,2,'Account','Wie fge ich Bilder hinzu und wie lsche ich Bilder von mir?','Deine Bilder kannst du in der Profilbearbeitung hinzufgen und lschen.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(46,2,'Features LovePush','Profil & Posts','Gestalte ein interessantes und echtes Profil!\r\nZudem kannst du Bilder in deinem Profil posten - Bilder sagen mehr als 1000 Worte!','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(47,2,'Features LovePush','Swipe','Du kannst zwischen \"next\", \"connect\" oder \"date\" Request entscheiden. \r\nNachdem du gematcht hast, kannst du mit dem Chatten beginnen.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(48,2,'Features LovePush','Radar','Du hast einen berblick ber alle Personen in deiner Nhe. Besuche ihr Profil und connecte dich!','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(49,2,'Features LovePush','Love & Connect Ads','Verffentliche Love- oder Connect-Anzeigen in deiner ausgewhlten Stadt und lerne die richtigen Personen am richtigen Ort kennen.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(50,2,'Features LovePush','Personal Matching','Du erhltst Vorschlge fr Menschen, die zu deinem Charakter passen und welche die gleichen Interessen haben wie du.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(51,2,'Features LovePush','Around','Durch die von uns integrierte Google API hast du die Mglichkeit, die angesagtesten Bars, Restaurants, Festivals & Konzerte in deiner Umgebung zu erkunden und deine Kontakte direkt zu ihnen einzuladen.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(52,2,'Features LovePush','Live Streams','Starte oder nehme an einer Live-Session von Leuten in deiner Umgebung teil und schau zu, kommentiere oder nimm daran teil!','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(53,2,'Mitgliedschaften','Free & V.I.P Pass','Mit unserem V.I.P. Pass kannst du alle unsere Funktionen unbegrenzt nutzen und zudem mit unserem Partnerprogramm Geld verdienen. \r\nWeitere Informationen findest du in den Preisinformationen.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(54,2,'Mitgliedschaften','Free Trial','3 Tage kannst du den V.I.P. Pass und somit alle Features unbegrenzt testen!','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(55,2,'Mitgliedschaften','Love Points','Nicht schon wieder eine Mitgliedschaft?\r\nMit den LovePoints bist du vllig ungebunden!\r\nErhalte so viele Points, wie du kaufst ohne wiederkehrende Zahlungen.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(56,2,'Mitgliedschaften','Zahlungsmglichkeiten','Den V.I.P. Pass kannst du per PayPal, Kreditkarte und mit deiner Handynummer erwerben.\r\nLovePoints kannst du dir zudem noch mit Sofortberweisung sichern.\r\nDie Mitgliedsgebhr wird jeweils am ersten Tag eines Abrechnungszeitraums abgebucht.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(57,2,'Mitgliedschaften','Verlngerung der Mitgliedschaft','Deine Mitgliedschaft verlngert sich jeweils zum Ende deines Mitgliedsstarts um einen Monat.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(58,2,'Mitgliedschaften','Kndigung der Mitgliedschaft','Um fr den Folgemonat zu kndigen sende die Kndigung bis sptestens 5 Tage vor Ablauf deiner Mitgliedschaft an termination@love-push.com oder kndige direkt in der App.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(59,2,'Mitgliedschaften','Widerrufsrecht','Sende uns das Widerrufsrecht bis sptestens 14 Tagen nach Abschluss deiner Mitgliedschaft an termination@love-push.com .','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(60,2,'Affiliate','Wie werde ich Love Affiliate?','Alles, was du tun musst, ist, die Affiliate AGB\'s zu akzeptieren und einen aktiven V.I.P. Pass zu besitzen.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(61,2,'Affiliate','Wie bekomme ich Teampartner?','Kopiere deinen Empfehlungscode in der Affiliate Overview und sende ihn an deine Freunde.\r\nDu kannst damit auch auf Social Media werben.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(62,2,'Affiliate','Ab welchem Datum kann ich Provisionen verdienen?','Du kannst die Zeit bis zum neuen Jahr nutzen, um dein Team aufzubauen.\r\nAb Januar 2020 kannst du die ersten Provisionen verdienen.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(63,2,'Affiliate','Wie ist das Vergtungsmodell?','Du wirst auf 5 Ebenen vergtet, das genaue Modell finden Sie in den Partnerinformationen.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(64,2,'Affiliate','Bis wann muss eine Auszahlung beantragt werden?','Bis zum 24. eines jeden Monats im Affiliate Men unter Withdrawal, wenn Sie ein Mindestauszahlungssaldo von 25$ haben.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(65,2,'Affiliate','Wo und wann bekomme ich meine Provisionen ausgezahlt?','Wenn Sie Ihre Auszahlung erfolgreich beantragt haben, erhalten Sie Ihre Provision am 1. eines jeden Monats auf Ihr PayPal-Konto ausgezahlt.','1','2019-10-07 16:12:41','2019-10-07 16:23:05'),(66,2,'Affiliate','Muss ich mich selbst um die Steuern kmmern?','Ja, Love Push zahlt Ihnen die Provisionen inkl. Steuern auf Ihr PayPal-Konto.','1','2019-10-07 16:12:41','2019-10-07 16:23:05');
